script: |
  super -f text -I q11840.spq | sort > q11840.out

inputs:
  - name: q11840.spq
    data: |
      SELECT + 56 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 NOT BETWEEN + - col0 AND - - col0;
  - name: tab1

outputs:
  - name: q11840.out
    data: |
      56
      56
      56
